import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import { Search, ShoppingCart, User, Menu } from 'lucide-react'; // Import icons

// In Navbar.js, add openSidebar to your destructuring:
const Navbar = ({ cartCount, openModal, user, openSidebar }) => {
  
  // Update the "All" button:
  <div onClick={openSidebar} style={{ cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '5px' }}>
     <Menu size={18} /> All
  </div>
  return (
    <header style={{ boxShadow: '0 2px 5px rgba(0,0,0,0.1)', position: 'sticky', top: 0, zIndex: 1000 }}>
      <div style={topBarStyle}>
        <Link to="/" style={logoStyle}>
           <span style={logoBox}>M</span> MegaMart
        </Link>
        
        <div style={searchContainer}>
          <input type="text" placeholder="Search for electronics..." style={searchInput} />
          <button style={searchButton}>
            <Search size={20} color="white" />
          </button>
        </div>

        <div style={navItems}>
          <Link to={user ? "/profile" : "/login"} style={linkItem}>
            <User size={20} color="#333" />
            <div style={navTextGroup}>
              <span style={smallText}>Hello, {user ? user.email.split('@')[0] : 'Sign In'}</span>
              <div style={boldText}>Account</div>
            </div>
          </Link>
          
          <div onClick={openModal} style={cartStyle}>
            <div style={cartWrapper}>
              <ShoppingCart size={24} color="#333" />
              {cartCount > 0 && <span style={badgeStyle}>{cartCount}</span>}
            </div>
            <span style={boldText}>Cart</span>
          </div>
        </div>
      </div>

      <div style={subBarStyle}>
        <span style={allCatBtn}><Menu size={18} /> All Categories</span>
        <span>Smartphones</span>
        <span>Laptops</span>
        <span>Accessories</span>
      </div>
    </header>
  );
};

const topBarStyle = { backgroundColor: '#ffffff', padding: '10px 50px', display: 'flex', alignItems: 'center', gap: '30px', borderBottom: '1px solid #eee' };
const logoBox = { backgroundColor: '#008ECC', color: 'white', padding: '5px 12px', borderRadius: '8px', marginRight: '5px', fontWeight: 'bold' };
const logoStyle = { color: '#1a1a1a', textDecoration: 'none', fontSize: '22px', fontWeight: '900', display: 'flex', alignItems: 'center' };
const searchContainer = { flex: 1, display: 'flex', height: '42px', border: '2px solid #008ECC', borderRadius: '8px', overflow: 'hidden' };
const searchInput = { flex: 1, border: 'none', padding: '0 15px', outline: 'none' };
const searchButton = { backgroundColor: '#008ECC', border: 'none', padding: '0 20px', cursor: 'pointer', display: 'flex', alignItems: 'center' };
const navItems = { display: 'flex', gap: '25px', alignItems: 'center' };
const linkItem = { color: '#333', textDecoration: 'none', display: 'flex', alignItems: 'center', gap: '8px' };
const navTextGroup = { display: 'flex', flexDirection: 'column' };
const smallText = { fontSize: '11px', color: '#777' };
const boldText = { fontSize: '14px', fontWeight: 'bold' };
const cartStyle = { display: 'flex', alignItems: 'center', gap: '8px', cursor: 'pointer' };
const cartWrapper = { position: 'relative' };
const badgeStyle = { position: 'absolute', top: '-10px', right: '-10px', backgroundColor: '#FF4D4D', color: 'white', fontSize: '10px', borderRadius: '50%', padding: '2px 6px', fontWeight: 'bold' };
const subBarStyle = { backgroundColor: '#f8f9fa', padding: '8px 50px', display: 'flex', gap: '25px', fontSize: '13px', borderBottom: '1px solid #eee' };
const allCatBtn = { fontWeight: 'bold', display: 'flex', alignItems: 'center', gap: '5px', cursor: 'pointer' };

export default Navbar;
